import "../Components_scss/Home.scss";
import React from 'react'
import { Link } from 'react-router-dom'
import { Swiper, SwiperSlide } from 'swiper/react';
import SwiperCore from 'swiper/core';  // SwiperCore만 가져옵니다.
import { Navigation, Pagination, Autoplay } from 'swiper';

// 'swiper/css'를 추가로 가져옵니다.
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/autoplay';

SwiperCore.use([Navigation, Pagination, Autoplay]);

const Home = () => {
  return (
    <>
      <div className="HomeNav shadow-md border-t-2 border-gray-200 bg-white"></div>
      <div className="Home max-w-7xl mx-auto px-4 flex justify-end">
        {/* 실시간 검색어 */}
        <div className="describeMyself">
          <ul className="descriptionList">
            <li><b>1</b>Ambitious</li>
            <li><b>2</b>Promising</li>
            <li><b>3</b>Creative</li>
            <li><b>4</b>ambitious</li>
          </ul>
        </div>
        {/* 홈배너 */}
        <div className="mainSkill bg-indigo-600 pb-16 relative overflow-hidden">
            <div className="flex flex-row mb-10 absolute animate-slider">
                <img className="w-100 h-full mx-10" src="img/1.jpeg" alt="html logo" />
                <img className="w-110 h-full mr-10" src="img/1.jpeg" alt="css logo" />
                <img className="w-100 h-full mr-10" src="img/1.jpeg" alt="javascript logo" />
                <img className="w-120 h-full mr-10" src="img/1.jpeg"  alt="react logo" />

                <img className="w-100 h-full mr-10" src={html} alt="html logo" />
                <img className="w-110 h-full mr-10" src={css} alt="css logo" />
                <img className="w-100 h-full mr-10" src={javascript} alt="javascript logo" />
                <img className="w-120 h-full mr-10" src={react} alt="react logo" />
                <img className="w-120 h-full mr-10" src={vue} alt="vue logo" />
                <img className="w-120 h-full mr-10" src={nuxt} alt="nuxt logo" />
                <img className="w-120 h-full mr-10" src={scss} alt="scss logo" />
                <img className="w-120 h-full mr-10" src={styled} alt="styled logo" />
                <img className="w-130 h-full mr-10" src={tailwind} alt="tailwind logo" />
            </div>
        </div>
        {/* <div className="flex text-center bg-slate-600">
          <div className="text-4xl font-extrabold">홈화면이다.</div>
        </div> */}
      </div>
    </>
  );
}

export default Home;
